import React from "react";
import Logo from "../../assets/logo.svg";

import { Container, Form } from "./styles";

export default function CreateAccount() {
  state = {
    name: ""
  };

  return (
    <Container>
      <Form>
        <img src={Logo} alt="Osc-logo" />
        <Input
          type="text"
          onChange={this.handleChange}
          value={this.state.name}
        />
      </Form>
    </Container>
  );
}
